// src/App.js
import React from 'react';
import './App.css';

function App() {
  return (
    <div>
      {/* Navbar */}
      <nav className="navbar">
        <div className="logo">EduTech</div>
        <ul className="nav-links">
          <li>Home</li>
          <li>About Us</li>
          <li>Course</li>
          <li>Mentor</li>
          <li>
            <button className="login-button">Login</button>
          </li>
        </ul>
      </nav>

      {/* Tagline */}
      <div className="tagline">
        <h1>Empower Your Learning Journey</h1>
      </div>

      {/* Cards Section */}
      <div className="card-container">
        <div className="card">System Design</div>
        <div className="card">Data Structures & Algorithms</div>
        <div className="card">Playlist</div>
        <div className="card">Object-Oriented Programming</div>
        <div className="card">Cheat Sheet</div>
        <div className="card">Operating Systems</div>
      </div>
    </div>
  );
}

export default App;
